03-Development-Options/3-3-python-script.body:
Executing Python Scripts in Zero-Touch Nodes (C#)
If you are comfortable writing scripts in Python and want more functionality out of the standard Dynamo Python nodes, we can use Zero-Touch to create our own. Let's start with a simple example that allows us to pass a python script as a string to a Zero-Touch node where the script is executed and a result is returned. This case study will build on the walk-throughs and examples in the Getting Started section, please refer to those if you are completely new to creating Zero-Touch nodes.


A Zero-Touch node that will execute a Python script string

Python Engine
This node relies on an instance of the IronPython scripting engine.  To do this, we need to reference a few additional assemblies. Follow the steps below to setup a basic template in Visual Studio:

Create a new Visual Studio class project
Add a reference to the IronPython.dll located in C:\Program Files (x86)\IronPython 2.7\IronPython.dll
Add a reference to the Microsoft.Scripting.dll located in C:\Program Files (x86)\IronPython 2.7\Platforms\Net40\Microsoft.Scripting.dll
Include the IronPython.Hosting and Microsoft.Scripting.Hosting using statements in your class
Add an private empty constructor to prevent an additional node from being added to the Dynamo library with our package
Create a new method that takes a single string as an input parameter
Within this method we will instantiate a new Python engine, and create an empty script scope.  You can imagine this scope as the global variables within an instance of the Python interpreter
Next, call Execute on the engine passing the input string and the scope as parameters
Finally, retrieve and return the results of the script by calling GetVariable on the scope and passing the name of the variable from your Python script that contains the value you are trying to return.  (See the example below for further details)

The following code provides an example for the step mentioned above. Building the solution will create a new .dll located in the bin folder of our project.  This .dll can now be imported into Dynamo as part of a package or by navigating toFile 
using IronPython.Hosting;
using Microsoft.Scripting.Hosting;

namespace PythonLibrary
{
    public class PythonZT
    {
        // Unless a constructor is provided, Dynamo will automatically create one and add it to the library
        // To avoid this, create a private constructor
        private PythonZT() { }

        // The method that executes the Python string
        public static string executePyString(string pyString)
        {
            ScriptEngine engine = Python.CreateEngine();
            ScriptScope scope = engine.CreateScope();
            engine.Execute(pyString, scope);
            // Return the value of the 'output' variable from the Python script below
            var output = scope.GetVariable("output");
            return (output);
        }
    }
}

The Python script is returning the variable output, which means we will need an output variable in the Python script. Use this sample script to test the node in Dynamo. If you have ever used the Python node in Dynamo the following should look familiar. For more information check out the Python section of the primer.
import clr
clr.AddReference('ProtoGeometry')
from Autodesk.DesignScript.Geometry import *

cube = Cuboid.ByLengths(10,10,10);
volume = cube.Volume
output = str(volume)

Multiple Outputs
One limitation of the standard Python nodes is that they only have a single output port so if we wish to return multiple object we must construct a list and retrieve each object in. If we modify the example above to return a dictionary, we can add as many output ports as we want. Refer to the Returning Multiple Values section in Going Further With Zero-Touch for more specifics on dictionaries.


This node is allowing us to return both the cuboid's volume and its centroid.

Let's modify the previous example with these steps:

Add a reference to DynamoServices.dll from the NuGet package manager
In addition to the previous assemblies include System.Collections.Generic and Autodesk.DesignScript.Runtime
Modify the return type on our method to return a dictionary which will contain our outputs
Each output must be individually retrieved from the scope (consider setting up a simple loop for larger sets of outputs)

using IronPython.Hosting;
using Microsoft.Scripting.Hosting;
using System.Collections.Generic;
using Autodesk.DesignScript.Runtime;

namespace PythonLibrary
{
    public class PythonZT
    {
        private PythonZT() { }

        [MultiReturn(new[] { "output1", "output2" })]
        public static Dictionary executePyString(string pyString)
        {
            ScriptEngine engine = Python.CreateEngine();
            ScriptScope scope = engine.CreateScope();
            engine.Execute(pyString, scope);
            // Return the value of 'output1' from script
            var output1 = scope.GetVariable("output1");
            // Return the value of 'output2' from script
            var output2 = scope.GetVariable("output2");
            // Define the names of outputs and the objects to return
            return new Dictionary {
                { "output1", (output1) },
                { "output2", (output2) }
            };
        }
    }
}

We have also added an additional output variable (output2) to the sample python script. Keep in mind that these variables can use any legal Python naming conventions, output has been used strictly for the sake of clarity in this example.
import clr
clr.AddReference('ProtoGeometry')
from Autodesk.DesignScript.Geometry import *

cube = Cuboid.ByLengths(10,10,10);
centroid = Cuboid.Centroid(cube);
volume = cube.Volume
output1 = str(volume)
output2 = str(centroid)

03-Development-Options/3-4-zerotouch-nod.body:
Going Further With Zero-Touch
With an understanding of how to create a Zero-Touch project, we can go deeper into the specifics of creating a node by walking through the ZeroTouchEssentials example on the Dynamo Github.


Many of Dynamo's standard nodes are essentially Zero-Touch nodes, like most of the Math, Color, and DateTime nodes above.

To start, download the ZeroTouchEssentials project from here: https://github.com/DynamoDS/ZeroTouchEssentials
In Visual Studio, open the ZeroTouchEssentials.sln solution file and build the solution.


The ZeroTouchEssentials.cs file contains all the methods we will be importing into Dynamo.

Open Dynamo and import the ZeroTouchEssentials.dll to get the nodes we will be referencing in the following examples.
The code examples are pulled from and generally match ZeroTouchEssentials.cs. The XML documentation has been removed to keep them concise, and each code example will create the node in the image above it.
Default Input Values
Dynamo supports the definition of default values for input ports on a node. These default values will be supplied to the node if the ports have no connections. Defaults are expressed using the C# mechanism of specifying optional arguments in the C# Programming Guide. Default are specified in the following way:

Set method parameters to a default value: inputNumber = 2.0

namespace ZeroTouchEssentials
{
    public class ZeroTouchEssentials
    {
        // Set the method parameter to a default value
        public static double MultiplyByTwo(double inputNumber = 2.0) 
        {
            return inputNumber * 2.0;
        }
    }
}




The default value will show up when hovering over the node input port


Returning Multiple Values
Returning multiple values is a bit more complex than creating multiple inputs and will need to be returned using a dictionary. The dictionary's entries become ports on the output side of the node. Multiple return ports are created in the following way:

Add using System.Collections.Generic; to use Dictionary<>.
Add using Autodesk.DesignScript.Runtime; to use the MultiReturn attribute. This references "DynamoServices.dll" from the DynamoServices NuGet package.
Add the [MultiReturn(new[] { "string1", "string2", ... more strings here })] attribute to the method. The strings refer to keys in the dictionary and will become the output port names.
Return a Dictionary<> from the function with keys that match the parameter names in the attribute: return new Dictionary

using System.Collections.Generic;
using Autodesk.DesignScript.Runtime;

namespace ZeroTouchEssentials
{
    public class ZeroTouchEssentials
    {
        [MultiReturn(new[] { "add", "mult" })]
        public static Dictionary ReturnMultiExample(double a, double b)
        {
            return new Dictionary

                { "add", (a + b) },
                { "mult", (a * b) }
            };
        }
    }
}


Refer to this code example in ZeroTouchEssentials.cs

A node that returns multiple outputs.


Notice that there are now two output ports named according to the strings we entered for the dictionary's keys.

Documentation, Tooltips, and Search
It is best practice to add documentation to Dynamo nodes that describe the node's function, inputs, outputs, search tags, etc. This is done through XML documentation tags. XML documentation is created in the following way:

Any comment text that is preceded by three forward slashes is considered to be documentation
For example: /// Documentation text and XML goes here


After the three slashes, create XML tags above methods that Dynamo will read when importing the .dll
For example: /// ...


Enable XML documentation in Visual Studio by selecting Project > Project Properties > Build and checking XML documentation file



Visual Studio will generate an XML file at the specified location

The types of tags are as follows:

/// ... is the main documentation for your node and will appear as a tooltip over your node in the left search side bar
/// ... will create documentation for specific input parameters
/// ... will create documentation for an output parameter
/// ... will create documentation for multiple output parameters
/// ... will match your node with search results based on a comma separated list. For example, if we create a node that subdivides a mesh we may want to add tags such as "mesh", "subdivision", and "catmull-clark".

The following is an example node with input and output descriptions, as well as a summary that will display in the Library.
using Autodesk.DesignScript.Geometry;

namespace ZeroTouchEssentials
{
    public class ZeroTouchEssentials
    {
        /// 
        /// This method demonstrates how to use a native geometry object from Dynamo
        /// in a custom method
        /// 
        /// Input Curve. This can be of any type deriving from Curve, such as NurbsCurve, Arc, Circle, etc
        /// The twice the length of the Curve 
        /// example,curve
        public static double DoubleLength(Curve curve)
        {
            return curve.Length * 2.0;
        }
    }
}


Refer to this code example in ZeroTouchEssentials.cs

Note that the code for this example node contains:


A node summary
An input description
An output description


Objects
Dynamo doesn't have a new keyword, so objects will need to be constructed using static construction methods. Objects are constructed in the following way:

Make the constructor internal internal ZeroTouchEssentials() unless otherwise required
Construct the object with a static method such as public static ZeroTouchEssentials ByTwoDoubles(a, b)


Note: Dynamo uses the "By" prefix to indicate a static method is a constructor, and while this is optional, using "By" will help your library better fit into the existing Dynamo style.

namespace ZeroTouchEssentials
{
    public class ZeroTouchEssentials
    {
        private double _a;
        private double _b;

        // Make the constructor internal
        internal ZeroTouchEssentials(double a, double b)
        {
            _a = a;
            _b = b;
        }

        // The static method that Dynamo will convert into a Create node
        public static ZeroTouchEssentials ByTwoDoubles(double a, double b)
        {
            return new ZeroTouchEssentials(a, b);
        }
    }
}


Refer to this code example in ZeroTouchEssentials.cs

After the ZeroTouchEssentials dll has been imported there will be a ZeroTouchEssentials node in the library. This object can be created by using the ByTwoDoubles node.

Using Dynamo Geometry Types
Dynamo libraries can use native Dynamo geometry types as inputs and create new geometry as outputs. Geometry types are created in the following way:

Reference "ProtoGeometry.dll" in the project by including using Autodesk.DesignScript.Geometry; at the top of your C# file and adding the ZeroTouchLibrary NuGet package to the project.
Important: Manage the geometry resources that are not returned out of your functions, see the Dispose/using Statements section below.


Note: Dynamo geometry objects are used like any other passed object to functions.

using Autodesk.DesignScript.Geometry;

namespace ZeroTouchEssentials
{
    public class ZeroTouchEssentials
    {
        // "Autodesk.DesignScript.Geometry.Curve" is specifying the type of geometry input, 
        // just as you would specify a double, string, or integer 
        public static double DoubleLength(Autodesk.DesignScript.Geometry.Curve curve)
        {
            return curve.Length * 2.0;
        }
    }
}


Refer to this code example in ZeroTouchEssentials.cs

A node that gets a curve's length and doubles it.


This node accepts a Curve geometry type as an input.

Dispose/using Statements
Geometry resources that are not returned out of functions will need to be manually managed. The Dynamo engine will handle any geometry resources that are returned out of functions. Geometry resources that are not returned can be handled in the following ways:

With a using statement:
using (Point p1 = Point.ByCoordinates(0, 0, 0))
{
  using (Point p2 = Point.ByCoordinates(10, 10, 0))
  {
      return Line.ByStartPointEndPoint(p1, p2);
  }
}


The using statement is documented here


With manual Dispose calls:
Point p1 = Point.ByCoordinates(0, 0, 0);
Point p2 = Point.ByCoordinates(10, 10, 0);
Line l = Line.ByStartPointEndPoint(p1, p2);
p1.Dispose();
p2.Dispose();
return l;



Migrations
When publishing a newer version of a library, node names may change. Name changes can be specified in a migrations file so that graphs built on previous versions of a library continue to work properly when an update is made. Migrations are implemented in the following way:

Create a .xml file in the same folder as the .dll with the following format: "BaseDLLName".Migrations.xml
In the .xml, create a single ... element
Inside the migrations element, create ... elements for each name change
For each name change, provide an ... and ... element




Right-click and select Add > New Item
Choose XML File
For this project, we would name the migrations file ZeroTouchEssentials.Migrations.xml


This example code is telling Dynamo that any node named GetClosestPoint is now named ClosestPointTo.



    Autodesk.DesignScript.Geometry.Geometry.GetClosestPoint
    Autodesk.DesignScript.Geometry.Geometry.ClosestPointTo




Refer to this code example in ProtoGeometry.Migrations.xml

Generics
Zero-Touch currently does not support the use of generics. They can be used, but not in the code that is directly imported where the type is not set. Methods, properties, or classes that are generic and don’t have the type set cannot be exposed.
In the example below, a Zero-Touch node of type T will not be imported. If the rest of the library imports into Dynamo there will be missing type exceptions.
public class SomeGenericClass
{
    public SomeGenericClass()
    {
        Console.WriteLine(typeof(T).ToString());
    }  
}

Using a generic type with the type set in this example will import into Dynamo.
public class SomeWrapper
{
    public object wrapped;
    public SomeWrapper(SomeGenericClass someConstrainedType)
    {
        Console.WriteLine(this.wrapped.GetType().ToString());
    }
}

03-Development-Options/3-5-nodemodel-der.body:
NodeModel Case Study - Custom UI
NodeModel based nodes provides significantly more flexibility and power than the Zero-Touch nodes. In this example, we will take the Zero-Touch grid node to the next level by adding an integrated slider that randomizes the rectangle size.


The slider scales the cells relative to their size so the user doesn't have to provide a slider with the correct range.

The Model-View-Viewmodel Pattern
Dynamo is based on the model-view-viewmodel (MVVM) software architecture pattern to keep the UI separate from the back-end. When creating ZeroTouch nodes, Dynamo does the data bind between a node's data and its UI . To create a custom UI, we have  to add the data-binding logic.
At a high-level there are two parts to establishing a model-view relationship in Dynamo:

A NodeModel class to establish the core logic of the node (the "model")
A INodeViewCustomization class to customize how the NodeModel is being viewed (the "view")


NodeModel objects already have an associated view-model (NodeViewModel), so we can just focus on the model and view for custom UI.

How To Implement NodeModel
NodeModel nodes have several significant differences from Zero-Touch nodes that we will cover in this example. Before we jump into UI customization, let's start by building out the NodeModel logic.
1. Create project structure:
A NodeModel node can only call functions, so we need to separate the NodeModel and functions into different libraries. The standard way of doing this for Dynamo packages is creating separate projects for each. Start by creating a new Solution to encompass the projects.



Select File > New > Project
Select Other Project Types to bring up the Solution option
Select Blank Solution
Name the solution CustomNodeModel
Select Ok


Create two C# class library projects in the solution: one for functions and one to implement the NodeModel interface.



Right-click on the Solution and select Add > New Project
Choose Class Library
Name it CustomNodeModel
Click Ok
Repeat the process to add another project named CustomNodeModelFunctions


Next, we need to rename the class libraries that were automatically created and add one to the CustomNodeModel project. The class GridNodeModel implements the abstract NodeModel class, GridNodeView is used to customize the view, and GridFunction contains any functions we need to call.



Add another class by right-clicking on the CustomNodeModel project, selecting Add > New Item... and choose Class.
In the CustomNodeModel project, we need GridNodeModel.cs and GridNodeView.cs class
In the CustomNodeModelFunction project, we need a GridFunctions.cs class


Before we add any code to the classes, add the necessary packages for this project. CustomNodeModel will need ZeroTouchLibrary and WpfUILibrary, and CustomNodeModelFunction will only need ZeroTouchLibrary. The WpfUILibrary will be used in the UI customization we do later on, and ZeroTouchLibrary will be used for creating geometry. Packages can be added individually for projects. Since these packages have dependencies, Core and DynamoServices will be automatically installed.



Right-click on a project and select Manage NuGet Packages
Install only the required packages for that project


Visual Studio will copy the NuGet packages we referenced to the build directory. This can be set to false so we don't have any unnecessary files in the package.



Select Dynamo NuGet Packages
Set Copy Local to false


2. Inherit the NodeModel class
As mentioned previously, the primary aspect that makes a NodeModel node different from a ZeroTouch node is its implementation of the NodeModel class. A NodeModel node needs several functions from this class, and we can get them by adding :NodeModel after the class name.
Copy the following code into the GridNodeModel.cs.
using System;
using System.Collections.Generic;
using Dynamo.Graph.Nodes;
using CustomNodeModel.CustomNodeModelFunction;
using ProtoCore.AST.AssociativeAST;
using Autodesk.DesignScript.Geometry;

namespace CustomNodeModel.CustomNodeModel
{
    [NodeName("RectangularGrid")]
    [NodeDescription("An example NodeModel node that creates a rectangular grid. The slider randomly scales the cells.")]
    [NodeCategory("CustomNodeModel")]
    [InPortNames("xCount", "yCount")]
    [InPortTypes("double", "double")]
    [InPortDescriptions("Number of cells in the X direction", "Number of cells in the Y direction")]
    [OutPortNames("Rectangles")]
    [OutPortTypes("Autodesk.DesignScript.Geometry.Rectangle[]")]
    [OutPortDescriptions("A list of rectangles")]
    [IsDesignScriptCompatible]
    public class GridNodeModel : NodeModel
    {
        private double _sliderValue;
        public double SliderValue
        {
            get { return _sliderValue; }
            set
            {
                _sliderValue = value;
                RaisePropertyChanged("SliderValue");
                OnNodeModified(false);
            }
        }
        public GridNodeModel()
        {
            RegisterAllPorts();
        }
        public override IEnumerable BuildOutputAst(List inputAstNodes)
        {
            if (!HasConnectedInput(0) || !HasConnectedInput(1))
            {
                return new[] { AstFactory.BuildAssignment(GetAstIdentifierForOutputIndex(0), AstFactory.BuildNullNode()) };
            }
            var sliderValue = AstFactory.BuildDoubleNode(SliderValue);
            var functionCall =
              AstFactory.BuildFunctionCall(
                new Func>(GridFunction.RectangularGrid),
                new List { inputAstNodes[0], inputAstNodes[1], sliderValue });

            return new[] { AstFactory.BuildAssignment(GetAstIdentifierForOutputIndex(0), functionCall) };
        }
    }
}

This different from Zero-Touch nodes. Let's understand what each part is doing.

Specify the Node attributes like Name, Category, InPort/OutPort names, InPort/OutPort types, descriptions.

public class GridNodeModel : NodeModel is a class that inherits the NodeModel class from Dynamo.Graph.Nodes.

public GridNodeModel() { RegisterAllPorts(); } is a constructor that registers the node inputs and outputs.

BuildOutputAst() returns an AST (Abstract Syntax Tree), the required structure for returning data from a NodeModel node.

AstFactory.BuildFunctionCall() calls the RectangularGrid function from GridFunctions.cs.

new Func>(GridFunction.RectangularGrid) specifies the function and  its parameters .

new List { inputAstNodes[0], inputAstNodes[1], sliderValue }); maps the node inputs to function parameters

AstFactory.BuildNullNode() builds a null node if the input ports are not connected. This is to avoid displaying a warning on the node.

RaisePropertyChanged("SliderValue")Notifies the UI when the slider value changes

var sliderValue = AstFactory.BuildDoubleNode(SliderValue)Build a node in the AST that represents the slider value

Change an input to the sliderValue variable in the functionCall variable new List { inputAstNodes[0], sliderValue });


3. Call a function
The CustomNodeModelFunction project will be built into a separate assembly from CustomNodeModel so that it can be called.
Copy the following code into GridFunction.cs.
using Autodesk.DesignScript.Geometry;
using Autodesk.DesignScript.Runtime;
using System;
using System.Collections.Generic;

namespace CustomNodeModel.CustomNodeModelFunction
{
    [IsVisibleInDynamoLibrary(false)]
    public class GridFunction
    {
        [IsVisibleInDynamoLibrary(false)]
        public static List RectangularGrid(int xCount = 10, int yCount = 10, double rand = 1)
        {
            double x = 0;
            double y = 0;

            Point pt = null;
            Vector vec = null;
            Plane bP = null;

            Random rnd = new Random(2);

            var pList = new List();
            for (int i = 0; i 
This function class is very similar to the Zero-Touch Grid case study with one difference:

[IsVisibleInDynamoLibrary(false)] prevents Dynamo from "seeing" the following method and class since the function is already being called from CustomNodeModel.

Just as we added references for NuGet packages, CustomNodeModel will need to reference CustomNodeModelFunction to call the function.


The using statement for CustomNodeModel will be inactive until we reference the function  

Right-click on CustomNodeModel and select Add > Reference  
Choose Projects > Solution  
Check CustomNodeModelFunction  
Click Ok


4. Customize the view
To create a slider, we need to customize the UI by implementing the INodeViewCustomization interface.
Copy the following code into GridNodeView.cs
using Dynamo.Controls;
using Dynamo.Wpf;

namespace CustomNodeModel.CustomNodeModel
{
    public class CustomNodeModelView : INodeViewCustomization
    {
        public void CustomizeView(GridNodeModel model, NodeView nodeView)
        {
            var slider = new Slider();
            nodeView.inputGrid.Children.Add(slider);
            slider.DataContext = model;
        }

        public void Dispose()
        {
        }
    }
}


public class CustomNodeModelView : INodeViewCustomization defines the necessary functions  to customize the UI. 

After the structure of the project is set up,  use Visual Studio's design environment to build a user control and define its parameters in an .xaml file. From the tool box, add a slider to ....



Right click on CustomNodeModel and select Add > New Item
Select WPF
Name the user control Slider
Click Add


Copy the following code into Slider.xaml







The parameters of the slider control is defined in In the .xaml file. Minimum and Maximum attributes defines the the numerical range of this slider.

Inside ... we can place  different user controls from the Visual Studio Toolbox


When we created the Slider.xaml file, Visual Studio automatically created a C# file called Slider.xaml.cs that initializes the slider. Change the namespace in this file.
using System.Windows.Controls;

namespace CustomNodeModel.CustomNodeModel
{
    /// 
    /// Interaction logic for Slider.xaml
    /// 
    public partial class Slider : UserControl
    {
        public Slider()
        {
            InitializeComponent();
        }
    }
}


The namespace should be CustomNodeModel.CustomNodeModel

The GridNodeModel.cs, defines the slider computation logic.
5. Configure as a package
Before we build the project, the final step is to add a pkg.json file so that Dynamo can read the package.



Right-click on CustomNodeModel and select Add > New Item
Select Web
Select JSON File
Name the file pkg.json
Click Add



Copy the following code into pkg.json

{
  "license": "MIT",
  "file_hash": null,
  "name": "CustomNodeModel",
  "version": "1.0.0",
  "description": "Sample node",
  "group": "CustomNodes",
  "keywords": [ "grid", "random" ],
  "dependencies": [],
  "contents": "Sample node",
  "engine_version": "1.3.0",
  "engine": "dynamo",
  "engine_metadata": "",
  "site_url": "",
  "repository_url": "",
  "contains_binaries": true,
  "node_libraries": [
    "CustomNodeModel, Version=1.0.0, Culture=neutral, PublicKeyToken=null",
    "CustomNodeModelFunction, Version=1.0.0, Culture=neutral, PublicKeyToken=null"
  ]
}


"name": determines the name of the package and its group in the Dynamo Library

"keywords": provide search terms for searching the Dynamo Library

"node_libraries": []  the libraries associated with the package
The last step is to build the solution and publish as a Dynamo package. Please see the Package Deployment chapter for how to create a local package before publishing online and how to build a package right out of Visual Studio.

03-Development-Options/upgrade-nodes-for.body:
Updating your Packages and Dynamo libraries for Dynamo 2.x.
Introduction:
Dynamo 2.0 is a major release and some APIs have been changed or removed. One of the largest changes that will effect node and package authors is our move to a JSON file format.
In general Zero Touch node authors will have little to no work to do to get their packages running in 2.0.
UI nodes and nodes that derive directly from NodeModel will take more work to get running in 2.x.
Extension authors may also have some potential changes to make - depending on how much of the Dynamo core APIs they use in their extensions.

General packaging rules:

Do not bundle Dynamo or Dynamo Revit .dlls with your package. These dlls will already be loaded by dynamo. If you bundle a different version than the user has loaded (ie you distribute dynamo core 1.3 but the user is running your package on dynamo 2.0) mysterious runtime bugs will occur. This includes dlls like DynamoCore.dll, DynamoServices.dll, DSCodeNodes.dll, ProtoGeometry.dll

Do not bundle and distribute newtonsoft.json.net with your package if you can avoid it. This dll will also be loaded by dynamo 2.x already. The same issue as above can occur.

Do not bundle and distribute CEFSharp with your package if you can avoid it. This dll will also be loaded by Dynamo 2.x already. The same issue as above can occur.

In general avoid sharing dependencies with dynamo or revit if you need to control the version of that dependency.



Common Issues:
1) Upon opening a graph some nodes have multiple ports with the same name, but the graph looked fine when saving. This issue can have a few causes.
The common root cause is because the node was created using a constructor that recreated the ports. Instead a constructor which loaded the ports should have been used. These constructors are usually marked [JsonConstructor] see below for examples

This can occur because:

There was simply no matching [JsonConstructor], or it was not passed the Inports and Outports from the JSON .dyn.

There were two versions of JSON.net loaded into the same process at the same time causing .net runtime failure so that the [JsonConstructor] attribute could not be used correctly to mark the constructor.

DynamoServices.dll with a different version than the current dynamo version has been bundled with the package and is causing the .net runtime to fail to identify the [MultiReturn] attribute so zero touch nodes marked with various attributes will fail to have them applied. You might find that a node returns a single dictionary output instead of multiple ports.


2) Nodes are completely missing upon loading the graph with some errors in the console.

This might occur if your deserialization failed for some reason. It's good practice to serialize only properties you need. We can use [JsonIgnore] on complex properties you don't need to load or save to ignore them. Properties like a function pointer, delegate, action, or  event etc. These should not be serialized as they will usually fail to deserialize and cause a runtime error.


Upgrading In Depth:
Custom Nodes 1.3 - > 2.0
Organizing Custom Nodes in librarie.js
Known Issues:

A coinciding custom node name and category name at the same level in librarie.js causes unexpected behavior. QNTM-3653 - avoid using the same names for category and nodes.

Comments will be turned into block comments instead of line comments.

Short type names will be replaced with full names. For example if you did not specify a type when you load the custom node again you will see var[]..[] - as this is the default type.



Zero Touch Nodes 1.3 -> 2.0

In Dynamo 2.0 List and Dictionary types have been split and the syntax for creating Lists and Dictionaries has been changed. Lists are initialized using [] while dictionaries use {}.If you were previously using the DefaultArgument attribute to mark parameters on your zero touch nodes and used list syntax to default to a specific list like someFunc([DefaultArgument("{0,1,2}")]) - this will no longer be valid, and you will need to modify the DesignScript snippet to use the new initialization syntax for lists.

As noted above do not distribute Dynamo dlls with your packages. (DynamoCore, DynamoServices etc).



Node Model Nodes 1.3 -> 2.0
Node Model nodes require the most work to update to Dynamo 2.x. At a high level you will need to implement constructors that will only be used for loading your nodes from json in addition to the regular nodeModel constructors that are used for instantiating new instances of your node types. To differentiate between these you mark the load time constructors with [JsonConstructor] which is an attribute from newtonsoft.Json.net.
The names of the parameters in the constructor should generally match the names of the JSON properties - though this mapping gets more complicated if you override the names that are serialized using [JsonProperty] attributes.See the Json.net documentation for more information.

JSON Constructors
The most common change required for updating nodes derived from the NodeModel base class (or other dynamo core base classes, ie DSDropDownBase) is the need to add a JSON constructor to your class.
Your original parameter-less constructor will still handle initializing a new node that is created within Dynamo (via the library for example).  The JSON constructor is required to initialize a node that is deserialized (loaded) from a saved .dyn or .dyf file.
The JSON constructor differs from the base constructor in that it has PortModel parameters for the inPorts and outPorts, which are provided by the JSON loading logic. The call to register the ports for the node are not required here, as the data exists in the .dyn file.  An example of a JSON constructor looks like this:
using Newtonsoft.Json; //New dependency for Json
………
[JsonConstructor] //Attribute required to identity the Json constructor
//Minimum constructor implementation.  Note that the base method invocation must also be present.
FooNode(IEnumerable inPorts, IEnumerable outPorts) : base(inPorts, outPorts) { }
This syntax :base(Inports,outPorts){} calls the base nodeModel constructor and passes the deserialized ports to it.
Any special logic that existed in the class constructor that involves initialization of specific data that is serialized into the .dyn file (for example setting Port registration, lacing strategy, etc) are not required to be repeated in this constructor as these values can be read from the JSON.
This is the major difference between the JSON constructor and non-JSON constructors for your nodeModels. JSON constructors are invoked when loading from a file and are passed loaded data.  Other user logic however must be duplicated in the JSON constructor (for example, initializing event handlers for the node or attaching).
Examples can be found here in the DynamoSamples repo -> ButtonCustomNodeModel, DropDown, or SliderCustomNodeModel

Public Properties and Serialization
Previously a developer could serialize and deserialize specific model data to the xml document via the SerializeCore and DeserializeCore methods.  These methods still exist in the API but will be deprecated in a future release of Dynamo (an example can be found here). With the JSON.NET implementation now public properties on the NodeModel derived class can be serialized to the .dyn file directly.  JSON.Net provides multiple attributes to control how the property is serialized.
This example which specifies a PropertyName is found here in the Dynamo repo.
[JsonProperty(PropertyName = "InputValue")]
public DSColor DsColor {...

Converters:
Note If you make your own JSON.net converter class, Dynamo does not currently have a mechanism to let you inject it into the load and save methods and so even if you mark your class with the [JsonConverter] attribute it may not be used - instead you can call your converter directly in your setter or getter. //TODO need confirmation of this limitation. Any evidence is welcome.
An example that specifies a serialization method to convert the property to a string is found here in the Dynamo repo.
[JsonProperty("MeasurementType"), JsonConverter(typeof(StringEnumConverter))]
public ConversionMetricUnit SelectedMetricConversion{...

Ignoring Properties
public properties that are not meant for serialization need to have the [JsonIgnore] attribute added.  When the nodes is saved to the .dyn file this insures this data is ignored by the serialization mechanism and will not cause unexpected consequences when the graph is opened again.  An example of this can be here in the Dynamo repo.

Undo/Redo
As mentioned above SerializeCore and DeserializeCore methods were used in the past to save and load nodes into the xml .dyn file. In addition they were also used to save and load the node state for undo/redo and still are! If you wish to implement complex undo/redo functionality for your nodeModel UI node then you will need to implement these methods and serialize into the XML document object provided as a parameter to these methods. This should be a rare use case except for complex UI nodes.

Input and Output Port APIs
One common occurrence in nodeModel nodes affected by 2.0 API changes is port registration in the node constructor.  Looking at examples in the Dynamo or DynamoSamples repo you previously will have found use of the InPortData.Add() or OutPortData.Add() methods.  Previously in the Dynamo API the InPortData and OutPortData public properties were marked as deprecated.  In 2.0 these properties have been removed.  Developers should now use InPorts.Add() and OutPorts.Add() methods.  Additionally these two Add() methods have slightly different signatures:
InPortData.Add(new PortData("Port Name", "Port Description")); //Old version valid in 1.3 but now deprecated
vs
InPorts.Add(new PortModel(PortType.Input, this, new PortData("Port Name", "Port Description"))); //Recommended 2.0
Examples of converted code can be found here in the Dynamo Repo -> DynamoConvert.cs, or FileSystem.cs
The other common use case that is affected by the 2.0 API changes relates to the methods commonly used in the BuildAst() method to determine node behavior based on the presence or absence of port connectors.  Previously HasConnectedInput(index) was used to validate a connected port state.  Developers should now use the InPorts[0].IsConnected property to check the port connection state.  An example of the this con be found in ColorRange.cs in the Dynamo Repo.

Examples:
Let's walk through upgrading a 1.3 UI node to Dynamo 2.x.
using System;
using System.Collections.Generic;
using Dynamo.Graph.Nodes;
using CustomNodeModel.CustomNodeModelFunction;
using ProtoCore.AST.AssociativeAST;
using Autodesk.DesignScript.Geometry;

namespace CustomNodeModel.CustomNodeModel
{
    [NodeName("RectangularGrid")]
    [NodeDescription("An example NodeModel node that creates a rectangular grid. The slider randomly scales the cells.")]
    [NodeCategory("CustomNodeModel")]
    [InPortNames("xCount", "yCount")]
    [InPortTypes("double", "double")]
    [InPortDescriptions("Number of cells in the X direction", "Number of cells in the Y direction")]
    [OutPortNames("Rectangles")]
    [OutPortTypes("Autodesk.DesignScript.Geometry.Rectangle[]")]
    [OutPortDescriptions("A list of rectangles")]
    [IsDesignScriptCompatible]
    public class GridNodeModel : NodeModel
    {
        private double _sliderValue;
        public double SliderValue
        {
            get { return _sliderValue; }
            set
            {
                _sliderValue = value;
                RaisePropertyChanged("SliderValue");
                OnNodeModified(false);
            }
        }
        public GridNodeModel()
        {
            RegisterAllPorts();
        }
        public override IEnumerable BuildOutputAst(List inputAstNodes)
        {
            if (!HasConnectedInput(0) || !HasConnectedInput(1))
            {
                return new[] { AstFactory.BuildAssignment(GetAstIdentifierForOutputIndex(0), AstFactory.BuildNullNode()) };
            }
            var sliderValue = AstFactory.BuildDoubleNode(SliderValue);
            var functionCall =
              AstFactory.BuildFunctionCall(
                new Func>(GridFunction.RectangularGrid),
                new List { inputAstNodes[0], inputAstNodes[1], sliderValue });

            return new[] { AstFactory.BuildAssignment(GetAstIdentifierForOutputIndex(0), functionCall) };
        }
    }
}

All we need to do to this nodeModel class to get it loading and saving correctly in 2.0 is add a jsonConstructor to handle loading of the ports. We simply pass the ports on the base constructor and this implementation is empty.
[JsonConstructor]
protected GridNodeModel(IEnumerable Inports, IEnumerable Outports ) :
base(Inports,Outports)
{

}

Note: Do not call RegisterPorts() or some variation of that in your JsonConstructor - this will use the input and output parameter attributes on your node class to construct new ports! We don't want this, since we want to use the loaded ports which are passed to your constructor.
[InPortNames("xCount", "yCount")]
[InPortTypes("double", "double")]
This example adds the minimal loading JSON constructor possible. But what if we need to do some more complex construction logic, like setup some listeners for event handling inside the constructor. The next sample taken from theDynamoSamples Repo is linked above in the JsonConstructors Section of this document.
Here is a more complex constructor for a UI node:
 public ButtonCustomNodeModel()
        {
            // When you create a UI node, you need to do the
            // work of setting up the ports yourself. To do this,
            // you can populate the InPorts and the OutPorts
            // collections with PortData objects describing your ports.
            InPorts.Add(new PortModel(PortType.Input, this, new PortData("inputString", "a string value displayed on our button")));

            // Nodes can have an arbitrary number of inputs and outputs.
            // If you want more ports, just create more PortData objects.
            OutPorts.Add(new PortModel(PortType.Output, this, new PortData("button value", "returns the string value displayed on our button")));
            OutPorts.Add(new PortModel(PortType.Output, this, new PortData("window value", "returns the string value displayed in our window when button is pressed")));

            // This call is required to ensure that your ports are
            // properly created.
            RegisterAllPorts();

            // Listen for input port disconnection to trigger button UI update
            this.PortDisconnected += ButtonCustomNodeModel_PortDisconnected;

            // The arugment lacing is the way in which Dynamo handles
            // inputs of lists. If you don't want your node to
            // support argument lacing, you can set this to LacingStrategy.Disabled.
            ArgumentLacing = LacingStrategy.Disabled;

            // We create a DelegateCommand object which will be 
            // bound to our button in our custom UI. Clicking the button 
            // will call the ShowMessage method.
            ButtonCommand = new DelegateCommand(ShowMessage, CanShowMessage);

            // Setting our property here will trigger a 
            // property change notification and the UI 
            // will be updated to reflect the new value.
            ButtonText = defaultButtonText;
            WindowText = defaultWindowText;
        }

When we add a JSON constructor for loading this node from a file we have to recreate some of this logic, but note that we do not include the code that creates ports, sets lacing, or sets the default values for properties which we can load from the file.
        // This constructor is called when opening a Json graph.

        [JsonConstructor]
        ButtonCustomNodeModel(IEnumerable inPorts, IEnumerable outPorts) : base(inPorts, outPorts)
        {
            this.PortDisconnected += ButtonCustomNodeModel_PortDisconnected;
            ButtonCommand = new DelegateCommand(ShowMessage, CanShowMessage);
        }

Note that other public properties that were serialized into the JSON like ButtonText and WindowText will not to be added as explicit parameters to the constructor - they are set automatically by JSON.net using the setters for those properties.

03-Development-Options/3-6-extensions.ht.body:
Extensions
Extensions are a powerful development tool in the Dynamo ecosystem.  They allow for developers to drive custom functionality based on Dynamo interactions and logic.  Extensions can be broken down into two main categories, extensions and view extensions.  As the naming implies, the view extension framework allows you to extend the Dynamo UI by registering custom menu items.  Regular extensions operate in a very similar fashion minus the UI.  For instance, we could build an extension that logs specific information to the Dynamo console.  This scenario requires no custom UI and therefore could also be accomplished using an extension.
Extension Case Study
Following the SampleViewExtension example from the DynamoSamples Github repository, we will walk through the steps necessary to create a simple modeless window that displays the active nodes in the graph in real-time. A view extension requires that we create a UI for the window and bind values to a view model.



The view extension window developed following the SampleViewExtension example in the Github repository.


Though we will build the example from the ground up, you can also download and build the DynamoSamples repository to serve as a reference.
The DynamoSamples repository: https://github.com/DynamoDS/DynamoSamples

This walk-through will be specifically referencing the project named SampleViewExtension found in DynamoSamples/src/.

How to implement a view extension
A view extension has three essential parts:

An assembly containing a class that implements IViewExtension as well as a class that creates a view model
An .xml file that tells Dynamo where it should look for this assembly at runtime, and the type of extension
An .xaml file that binds data to the graphic display and determines the window's appearance

1. Create the project structure
Start by creating a new Class Library project named SampleViewExtension.



Create a new project by selecting File > New > Project
Select Class Library
Name the project SampleViewExtension
Select Ok


In this project, we will need two classes. One class will implement IViewExtension and another that will implement NotificationObject. IViewExtension will contain all the information about how our extension will be deployed, loaded, referenced, and disposed.  NotificationObject will provide notifications for changes in Dynamo and IDisposable When a change occurs the count will update accordingly.



A class file named SampleViewExtension.cs that will implement IViewExtension
A class file named SampleWindowViewMode.cs that will implement NotificationObject


To use IViewExtension, we will need the WpfUILibrary NuGet package. Installing this package will automatically install the Core, Services, and ZeroTouchLibrary packages.



Select the WpfUILibrary
Select Install to install all dependent packages


2. Implement the IViewExtension class
From the IViewExtension class we will determine what happens when Dynamo starts up, when the extension is loaded, and when Dynamo shuts down. In the SampleViewExtension.cs class file, add the following code:
using System;
using System.Windows;
using System.Windows.Controls;
using Dynamo.Wpf.Extensions;

namespace SampleViewExtension
{

    public class SampleViewExtension : IViewExtension
    {
        private MenuItem sampleMenuItem;

        public void Dispose()
        {
        }

        public void Startup(ViewStartupParams p)
        {
        }

        public void Loaded(ViewLoadedParams p)
        {
            // Save a reference to your loaded parameters.
            // You'll need these later when you want to use
            // the supplied workspaces

            sampleMenuItem = new MenuItem {Header = "Show View Extension Sample Window"};
            sampleMenuItem.Click += (sender, args) =>
            {
                var viewModel = new SampleWindowViewModel(p);
                var window = new SampleWindow
                {
                    // Set the data context for the main grid in the window.
                    MainGrid = { DataContext = viewModel },

                    // Set the owner of the window to the Dynamo window.
                    Owner = p.DynamoWindow
                };

                window.Left = window.Owner.Left + 400;
                window.Top = window.Owner.Top + 200;

                // Show a modeless window.
                window.Show();
            };
            p.AddMenuItem(MenuBarType.View, sampleMenuItem);
        }

        public void Shutdown()
        {
        }

        public string UniqueId
        {
            get
            {
                return Guid.NewGuid().ToString();
            }  
        } 

        public string Name
        {
            get
            {
                return "Sample View Extension";
            }
        } 

    }
}

The SampleViewExtension class creates a clickable menu item to open the window and connects it to the view model and window.

public class SampleViewExtension : IViewExtension SampleViewExtension inherits from the IViewExtension interface provides everything we need to create the menu item.

sampleMenuItem = new MenuItem { Header = "Show View Extension Sample Window" }; creates a MenuItem and adds it to the View menu.





The menu item



sampleMenuItem.Click += (sender, args) triggers an event that will open a new window when the menu item is clicked

MainGrid = { DataContext = viewModel } sets the data context for the main grid in the window, referring to Main Grid in the .xaml file we will create

Owner = p.DynamoWindow sets the owner of our pop-out window to Dynamo.  This means the new window is dependent on Dynamo so actions such as minimizing, maximizing, and restoring Dynamo will cause the new window to follow this same behavior

window.Show(); displays the window the additional window properties have been set


3. Implementing the view model
Now that we have established some of the window's basic parameters, we will add the logic for responding to various Dynamo related events and instruct the UI to update based on these events. Copy the following code into the SampleWindowViewModel.cs class file:
using System;
using Dynamo.Core;
using Dynamo.Extensions;
using Dynamo.Graph.Nodes;

namespace SampleViewExtension
{
    public class SampleWindowViewModel : NotificationObject, IDisposable
    {
        private string activeNodeTypes;
        private ReadyParams readyParams;

        // Displays active nodes in the workspace
        public string ActiveNodeTypes
        {
            get
            {
                activeNodeTypes = getNodeTypes();
                return activeNodeTypes;
            }
        }

        // Helper function that builds string of active nodes
        public string getNodeTypes()
        {
            string output = "Active nodes:\n";

            foreach (NodeModel node in readyParams.CurrentWorkspaceModel.Nodes)
            {
                string nickName = node.Name;
                output += nickName + "\n";
            }

            return output;
        }

        public SampleWindowViewModel(ReadyParams p)
        {
            readyParams = p;
            p.CurrentWorkspaceModel.NodeAdded += CurrentWorkspaceModel_NodesChanged;
            p.CurrentWorkspaceModel.NodeRemoved += CurrentWorkspaceModel_NodesChanged;
        }

        private void CurrentWorkspaceModel_NodesChanged(NodeModel obj)
        {
            RaisePropertyChanged("ActiveNodeTypes");
        }

        public void Dispose()
        {
            readyParams.CurrentWorkspaceModel.NodeAdded -= CurrentWorkspaceModel_NodesChanged;
            readyParams.CurrentWorkspaceModel.NodeRemoved -= CurrentWorkspaceModel_NodesChanged;
        }
    }
}

This implementation of the view model class listens to the CurrentWorkspaceModel and triggers an event when a node is added or removed from the workspace.  This raises a property change that notifies the UI or bound elements that the data has changed and needs to be updated. The ActiveNodeTypes getter is called which internally calls an additional helper function getNodeTypes().  This function iterates through all the active nodes on the canvas, populate a string containing the names of these nodes, and returns this string to our binding in the .xaml file to be displayed in our pop-out window.
With the core logic of the extension defined, we will now specify the appearance details of the window with an .xaml file. All we need is a simple window that will display the string via the ActiveNodeTypes property binding in theTextBlock Text.



Right-click on the project and select Add > New Item...
Select the User Control template which we will alter to create a window
Name the new file SampleWindow.xaml
Select Add


In the window .xaml code, we will need to bind SelectedNodesText to a text block. Add the following code to SampleWindow.xaml:







Text="{Binding ActiveNodeTypes}" binds to the property value of ActiveNodeTypes in SampleWindowViewModel.cs to the TextBlock Text value in the window.

We will now initialize the sample window in the .xaml C# backing file SampleWindow.xaml.cs. Add the following code to SampleWindow.xaml:
using System.Windows;

namespace SampleViewExtension
{
    /// 
    /// Interaction logic for SampleWindow.xaml
    /// 
    public partial class SampleWindow : Window
    {
        public SampleWindow()
        {
            InitializeComponent();
        }
    }
}

The view extension is now ready to be built and added to Dynamo.  Dynamo requires an xml file in order to register our output .dll as an extension.



Right-click on the project and select Add > New Item...
Select XML file
Name the file SampleViewExtension_ViewExtensionDefinition.xml
Select Add



The file name follows the Dynamo standard for referencing an extension assembly like so: "extensionName"_ViewExtensionDefinition.xml

In the xml file, add the following code to tell Dynamo where to look for the extension assembly:

  C:\Users\username\Documents\Visual Studio 2015\Projects\SampleViewExtension\SampleViewExtension\bin\Debug\SampleViewExtension.dll
  SampleViewExtension.SampleViewExtension



In this example, we built the assembly to the default Visual Studio project folder. Replace the ... target with the location of the assembly.

The last step is to copy the SampleViewExtension_ViewExtensionDefinition.xml file into Dynamo's view extensions folder located in the Dynamo Core installation directory C:\Program Files\Dynamo\Dynamo Core\1.3\viewExtensions.  It is important to note that there are separate folders for extensions and viewExtensions.  Placing the xml file in the incorrect folder may cause failure to properly load at runtime.



The .xml file we copied into Dynamo's view extensions folder


This is a basic introduction to view extensions. For a more sophisticated case study see the DynaShape package, an open source project on Github. The package uses a view extension that enables live editing in the Dynamo model view.
A package installer for DynaShape can be downloaded from the Dynamo Forum: https://forum.dynamobim.com/t/dynashape-published/11666
The source code can be cloned from Github: https://github.com/LongNguyenP/DynaShape
